import React, { Component } from 'react';
import './RegisterCustomer.css'
export default class RegisterCustomers extends Component {
    render() {
        return (
      <div className="background-register">
        <div className="login">
          <fieldset>
            <legend>Preencha os dados para Login</legend>
            <legend className="datas-to-login">Email</legend>
            <input placeholder="Digite aqui seu email" type="text" />
            <legend className="datas-to-login">Senha</legend>
            <input placeholder="Digite aqui sua senha" type="password" />
            {/* <Link className="to-costumer-base" to="/customers"> */}
              <a>Fazer Login</a>
            {/* </Link> */}
          </fieldset>
        </div>
      </div>
        )
    }
}
